		///-------------------------------------------------------------------------
		/// <summary>初期化</summary>
		///-------------------------------------------------------------------------
        static public void Initialize()
        {
            try
            {
                MotionList = new Dictionary<String, List<String>>( ConstantValues.Motion.Values.Count );

                // あらかじめ種別を登録しておく
                foreach( String namedMotionType in ConstantValues.Motion.Values )
                {
                    MotionList[ namedMotionType ] = new List<String>();
                }

                // CM3D2のファイル全列挙
                String[] allFiles = GameUty.FileSystem.GetList( "motion", AFileSystemBase.ListType.AllFile );

                foreach( String file in allFiles )
                {
                    String extension = Path.GetExtension( file );

                    // .anmファイルの場合(String.Compareが遅いので大文字拡張子は諦める･･･)
                    if( extension == ".anm" )
                    {
                        String motionName = Path.GetFileNameWithoutExtension( file );
                        String motionType = Path.GetDirectoryName( file );

                        // 読めるモーションのみ
                        if( motionName.EndsWith( "_m" ) == false && motionName.Contains( "_m_" ) == false && motionType.Contains( "_man" ) == false )
                        {
                            motionType = motionType.Replace( "motion\\", "" );

                            // 既知のモーション種別を置き換え(未知のモーションは据え置き)
                            String namedMotionType = motionType;
                            if( ConstantValues.Motion.ContainsKey( motionType ) )
                            {
                                namedMotionType = ConstantValues.Motion[ motionType ];
                            }

                            // リストに登録されていない場合
                            if( MotionList.ContainsKey( namedMotionType ) == false )
                            {
                                MotionList[ namedMotionType ] = new List<String>();
                            }

                            MotionList[ namedMotionType ].Add( motionName );
                        }
                    }
                }
            }
            catch( Exception e )
            {
                Debug.LogError( e.ToString() );
            }
        }
